webpackJsonp([0xfc93937c9c3e],{543:function(A,a){A.exports={data:{post:{html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-4a0f7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Our team"\n        title=""\n        src="/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-48538.png"\n        srcset="/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-bed0f.png 200w,\n/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-5fd34.png 400w,\n/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-48538.png 800w,\n/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-b70ec.png 1200w,\n/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-d134a.png 1600w,\n/static/rd-team-b2e1f26f2a2ff10fa9a16b61aa615078-4a0f7.png 1980w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Hello our beloved Community !</h3>\n<p>It’s for you ! </p>\n<p>Through this blog, we would like to let you in on our work backstage as we hope that it will give you a better understanding of what we are currently working on . This is a new chapter for us and we are thrilled to invite you along for the journey and to build a deeper relationship with all of you, our Centreon users.</p>\n<p>As you may be aware, we already launched a Slack workspace a few months ago and there are already more than 190+ members (at the time of writing) who are exchanging knowledge about Centreon on a daily basis. Besides, we have not had the opportunity to say thank you !</p>\n<p>So let us take this time to say, to all of you :</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/Thank-You-99875404fdaead0ac5d82a0614756519-b11b1.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 45.49590536851684%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Thank you"\n        title=""\n        src="/static/Thank-You-99875404fdaead0ac5d82a0614756519-78f2b.jpg"\n        srcset="/static/Thank-You-99875404fdaead0ac5d82a0614756519-dce19.jpg 200w,\n/static/Thank-You-99875404fdaead0ac5d82a0614756519-c1413.jpg 400w,\n/static/Thank-You-99875404fdaead0ac5d82a0614756519-78f2b.jpg 800w,\n/static/Thank-You-99875404fdaead0ac5d82a0614756519-b11b1.jpg 1099w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Over the years, the Centreon team worked hard to meet your expectations but there is still a lot left to do. That’s why we  dedicate our efforts into  improving the product, presenting you with new features, etc. On our way, we will experiment, make mistakes, encounter difficulties and we would like to share with you all of it over the coming months and years via this blog. We will also seek your help and feedback.</p>\n<p>But fear not!  We are not going to write only about PHP! We will also share with you our feedback on technologies that we will be trying, on POCs that we will be building, on meetups  and conferences that we will be attending, and so much more.</p>\n<p>We are not expecting every post on this blog will sweep you off your feet but we will do our best to keep this blog regularly up to date.</p>\n<p>Does this sound interesting to you ?</p>\n<p>If it does, then we invite you to become part of our community and give us feedback as we go. We would love to hear from you in the comments on this blog (the feature “comment an article” will come soon), and on our various social media platforms, including Twitter and the Slack workspace.</p>\n<p>Your can follow on twitter <a href="https://twitter.com/CentreonLabs">@CentreonLabs</a> and come to discuss with the community on the <a href="/register-slack">Centreon Slack</a>.</p>\n<p>#monitoringlove</p>\n<p>The Centreon R&#x26;D Team.</p>',fields:{date:"2018-09-15"},frontmatter:{title:"Welcome to our new blog",category:["general"],author:"Centreon R&D Team",cover:{childImageSharp:{resize:{src:"/static/cover-rd-69b90c7f7a6a62100f1a8c9d4a14a54b-2881c.png"}}}}}},pathContext:{slug:"/2018-09-15-welcome/"}}}});
